contracts/Vehicleinfo.sol.content:
// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

contract Vehicleinfo{
    struct Vehicle{
        string RegisterId;
        string CarBrand;
        string CarModel;
        string CarColor;
        string Merikelrootvalue;
        //address OwnedBy;
    }

    function AddVehicle (
        string memory RegisterId,
        string memory CarBrand,
        string memory CarModel,
        string memory CarColor,
        string memory Merikelrootvalue
        //address OwnedBy
    ) public {
        Vehicle(
                RegisterId,CarBrand,CarModel,CarColor,Merikelrootvalue
            );
    }

}

